import React from 'react';
import Navbar from '../components/UI/Navbar';
import Footer from '../components/UI/Footer';

import '../styles/dashboard.css';
import '../styles/global.css';


const DashBoard = () => {
  return (
    <div className='container'>
        <Navbar />
        <main className='main'>
          <article>
            <span>Ваш автомобиль наш цвет</span>
            <div>Мы предлагаем услуги опытного колориста и широкий ассортимент высококачественных автомобильных красок, которые помогут вернуть вашему авто первозданный блеск или придать ему совершенно новый облик.</div>
            <button className='btn'>Каталог</button>
          </article>
          <img className="img" src='#' />
        </main>
        <Footer />
    </div>
  );
};

export default DashBoard;
